import React from 'react';
import Carousello from './Carousel';
import './HomePage.css';
import ProvaRicerca from '../ProvaRicerca/ProvaRicerca';
import SecondaRicerca from '../secondaRicerca/secondaRicerca'

function HomePage(){
    return(
        <div className="HomePage">
            <div>
                <SecondaRicerca/>
            </div>
            <div>
                <Carousello/>
            </div>
            <br/>
            <div>
            <Card>
                <Card.Title>Struttura numero 1</Card.Title>
                <Card.Text>non so cosa vada scritto qua</Card.Text>
            </Card>
            </div>
        </div>
    );
}

export default HomePage;
